{
  "translationLines": [
    {
      "lineNumber": 225402,
      "originalJapaneseLine": "「あ、あの……",
      "translatedEnglishLine": "\"Um, um...\""
    },
    {
      "lineNumber": 225403,
      "originalJapaneseLine": "　＜エール＞ちゃんに頼っても、いいの……？」",
      "translatedEnglishLine": "\"Is it okay for me to rely on you, <Yell>-chan...?\""
    },
    {
      "lineNumber": 225404,
      "originalJapaneseLine": "あなたは頷いてみせた。",
      "translatedEnglishLine": "You nodded in response."
    },
    {
      "lineNumber": 225405,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 225406,
      "originalJapaneseLine": "「そっか、そうなんだ……」",
      "translatedEnglishLine": "\"I see, so that's how it is...\""
    },
    {
      "lineNumber": 225407,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 225408,
      "originalJapaneseLine": "スシヌの瞳が今まで一番、",
      "translatedEnglishLine": "Sushinu's eyes, more than ever before,"
    },
    {
      "lineNumber": 225409,
      "originalJapaneseLine": "大きく見開かれた。",
      "translatedEnglishLine": "opened wide."
    },
    {
      "lineNumber": 225410,
      "originalJapaneseLine": "どうやら、呆けてしまっているらしい。",
      "translatedEnglishLine": "It seemed she was stunned."
    },
    {
      "lineNumber": 225411,
      "originalJapaneseLine": "「そっか……",
      "translatedEnglishLine": "\"I see...\""
    },
    {
      "lineNumber": 225412,
      "originalJapaneseLine": "　誰かに助けてもらえるなんて……",
      "translatedEnglishLine": "To think someone could help me..."
    },
    {
      "lineNumber": 225413,
      "originalJapaneseLine": "　私、考えたこともなかった……」",
      "translatedEnglishLine": "I had never even thought about it...\""
    },
    {
      "lineNumber": 225414,
      "originalJapaneseLine": "「全部、自分でどうにかしないとって……」",
      "translatedEnglishLine": "\"That I had to handle everything by myself...\""
    },
    {
      "lineNumber": 225415,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 225416,
      "originalJapaneseLine": "「そう、だよね……",
      "translatedEnglishLine": "\"That's right...\""
    },
    {
      "lineNumber": 225417,
      "originalJapaneseLine": "　リセットお姉ちゃんも、",
      "translatedEnglishLine": "Big sister Reset too,"
    },
    {
      "lineNumber": 225418,
      "originalJapaneseLine": "　乱義お兄ちゃんも……」",
      "translatedEnglishLine": "Brother Ran-gi as well...\""
    },
    {
      "lineNumber": 225419,
      "originalJapaneseLine": "「それに、＜エール＞ちゃんも……",
      "translatedEnglishLine": "\"And also, <Yell>-chan as well...\""
    },
    {
      "lineNumber": 225420,
      "originalJapaneseLine": "　お願いしたら助けてくれるんだもんね……」",
      "translatedEnglishLine": "If I ask, you'll help me, won't you...?\""
    },
    {
      "lineNumber": 225421,
      "originalJapaneseLine": "「ふふっ……」",
      "translatedEnglishLine": "\"Hehe...\""
    },
    {
      "lineNumber": 225422,
      "originalJapaneseLine": "「ええええええっ！？",
      "translatedEnglishLine": "\"Ehhhhhh!?\""
    },
    {
      "lineNumber": 225423,
      "originalJapaneseLine": "「す、好き……好きって！？",
      "translatedEnglishLine": "\"I-I like you... like you!?\""
    },
    {
      "lineNumber": 225424,
      "originalJapaneseLine": "スシヌの顔がみるみる真っ赤に染まる。",
      "translatedEnglishLine": "Sushinu's face rapidly flushed bright red."
    },
    {
      "lineNumber": 225425,
      "originalJapaneseLine": "「あっ、って、えっ……あ、そういう意味……」",
      "translatedEnglishLine": "\"Ah, wait, huh... oh, you mean in that way...\""
    },
    {
      "lineNumber": 225426,
      "originalJapaneseLine": "「あう……うく……」",
      "translatedEnglishLine": "\"Auh... uku...\""
    },
    {
      "lineNumber": 225427,
      "originalJapaneseLine": "「でも、助ける、って……",
      "translatedEnglishLine": "\"But helping me...\""
    },
    {
      "lineNumber": 225428,
      "originalJapaneseLine": "「失敗、しても……助けて、くれるの？」",
      "translatedEnglishLine": "\"Even if I fail... you'll still help me?\""
    },
    {
      "lineNumber": 225429,
      "originalJapaneseLine": "あなたは強く頷いてみせた。",
      "translatedEnglishLine": "You nodded firmly."
    },
    {
      "lineNumber": 225430,
      "originalJapaneseLine": "「あうっ……」",
      "translatedEnglishLine": "\"Auh...\""
    },
    {
      "lineNumber": 225431,
      "originalJapaneseLine": "「う、うううう……」",
      "translatedEnglishLine": "\"U-uuu...\""
    },
    {
      "lineNumber": 225432,
      "originalJapaneseLine": "スシヌは顔を紅潮させながら、",
      "translatedEnglishLine": "Sushinu blushed deeply,"
    },
    {
      "lineNumber": 225433,
      "originalJapaneseLine": "それでもあなたの言葉を",
      "translatedEnglishLine": "but still seemed to be mentally digesting your words."
    },
    {
      "lineNumber": 225434,
      "originalJapaneseLine": "心の中で噛み砕いているようだ。",
      "translatedEnglishLine": "(continued above)"
    },
    {
      "lineNumber": 225435,
      "originalJapaneseLine": "「そっか……」",
      "translatedEnglishLine": "\"I see...\""
    },
    {
      "lineNumber": 225436,
      "originalJapaneseLine": "「誰かに頼ったりしても……",
      "translatedEnglishLine": "\"It's okay to rely on someone...\""
    },
    {
      "lineNumber": 225437,
      "originalJapaneseLine": "　よかったんだ……」",
      "translatedEnglishLine": "\"That's alright...\""
    },
    {
      "lineNumber": 225438,
      "originalJapaneseLine": "「考えたこともなかった……」",
      "translatedEnglishLine": "\"I had never thought about it...\""
    },
    {
      "lineNumber": 225439,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 225440,
      "originalJapaneseLine": "「えへへ、ありがとう……」",
      "translatedEnglishLine": "\"Ehehe, thank you...\""
    },
    {
      "lineNumber": 225441,
      "originalJapaneseLine": "花が咲くように。",
      "translatedEnglishLine": "Like a flower blooming."
    },
    {
      "lineNumber": 225442,
      "originalJapaneseLine": "スシヌが初めてあなたに笑顔を見せた。",
      "translatedEnglishLine": "For the first time, Sushinu showed you a smile."
    },
    {
      "lineNumber": 225443,
      "originalJapaneseLine": "「……私も、強くなる」",
      "translatedEnglishLine": "\"...I will become strong, too.\""
    },
    {
      "lineNumber": 225444,
      "originalJapaneseLine": "「私が守られるばかりじゃなくて、",
      "translatedEnglishLine": "\"Not just being protected myself,"
    },
    {
      "lineNumber": 225445,
      "originalJapaneseLine": "　ちゃんと誰かの役に立てるように……」",
      "translatedEnglishLine": "but so that I can properly be useful to someone...\""
    },
    {
      "lineNumber": 225446,
      "originalJapaneseLine": "「私、そういうスシヌになりたい」",
      "translatedEnglishLine": "\"I want to become that kind of Sushinu.\""
    },
    {
      "lineNumber": 225447,
      "originalJapaneseLine": "「えへへ……」",
      "translatedEnglishLine": "\"Ehehe...\""
    },
    {
      "lineNumber": 225448,
      "originalJapaneseLine": "「う、うん……私、頑張る……」",
      "translatedEnglishLine": "\"Y-Yeah... I'll do my best...\""
    },
    {
      "lineNumber": 225449,
      "originalJapaneseLine": "「それじゃ……」",
      "translatedEnglishLine": "\"Well then...\""
    },
    {
      "lineNumber": 225450,
      "originalJapaneseLine": "「納得いったみたいだしさ、",
      "translatedEnglishLine": "\"It seems you've come to accept it,"
    },
    {
      "lineNumber": 225451,
      "originalJapaneseLine": "　改めて誘ってもいいかな？」",
      "translatedEnglishLine": "so can I formally invite you again?\""
    },
    {
      "lineNumber": 225452,
      "originalJapaneseLine": "「おい、＜エール＞」",
      "translatedEnglishLine": "\"Hey, <Yell>.\""
    },
    {
      "lineNumber": 225453,
      "originalJapaneseLine": "あなたは長田君に促された。",
      "translatedEnglishLine": "You were prompted by Osada-kun."
    },
    {
      "lineNumber": 225454,
      "originalJapaneseLine": "「へ？　改めてって……」",
      "translatedEnglishLine": "\"Huh? Formally again...?\""
    },
    {
      "lineNumber": 225455,
      "originalJapaneseLine": "「…………。」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 225456,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 225457,
      "originalJapaneseLine": "「はい、こんな私で良かったら……」",
      "translatedEnglishLine": "\"Yes, if someone like me is okay...\""
    },
    {
      "lineNumber": 225458,
      "originalJapaneseLine": "「あはは、宜しくお願いします」",
      "translatedEnglishLine": "\"Ahaha, please take care of me.\""
    },
    {
      "lineNumber": 225459,
      "originalJapaneseLine": "「お……」",
      "translatedEnglishLine": "\"Oh...\""
    },
    {
      "lineNumber": 225460,
      "originalJapaneseLine": "「よっしゃー！",
      "translatedEnglishLine": "\"Alright!\""
    },
    {
      "lineNumber": 225461,
      "originalJapaneseLine": "　新しい魔王の子、仲間に出来たー！」",
      "translatedEnglishLine": "\"We've got a new Demon Lord's child to join us!\""
    }
  ]
}

